  \"2013-08-23T13:47:01.879544\",\n\t\"name\": \"organic-geochemistry-data-of-alaska-dds-59-version-10\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The U. S. Geological Survey Central Energy
  Resources Science Center's Organic Geochemistry Laboratory is a research laboratory
  devoted to the investigation of the origin and occurrence of organic fossil fuels.
  Although it is not a service laboratory, many of the analytical results from the
  laboratory could prove useful in future petroleum geological and geochemical studies.
  In order to archive these results, the USGS developed an Alaskan Organic Geochemical
  Data Base (AOGDB) in 1978 to house the data from not only the USGS's involvement
  in the project, but also the data accumulated from a variety of sub-contracting
  laboratories. The accumulated data resided in a flat text file entitled \"PGS\"
  and was maintained by Petroleum Information Corporation. The information provided
  here is a distillation of ASCII tables that originated in the master flat files
  of the relational AOGDB files.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
